// src/components/NavBar/LayoutWithNavbar.jsx
import React from 'react';
import { Outlet } from 'react-router-dom';
import NavbarCasual from './NavbarCasual';
import NavbarProfessional from './NavbarProfessional';

const LayoutWithNavbar = ({ isCasualNavbar, children }) => {
  const Navbar = isCasualNavbar ? NavbarCasual : NavbarProfessional;

  return (
    <div>
      <Navbar />
      <Outlet />
    </div>
  );
};

export default LayoutWithNavbar;
